import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* 상단 우측에 회원 목록 링크 추가 */}
        <div className="header-link">
          <Link to="/users">회원 목록</Link>
        </div>

        {/* 쇼핑몰 기본 레이아웃 */}
        <div className="shop-content">
          <h1>쇼핑몰</h1>
          <div className="shop-space">
            <div className="space-item">제품 1</div>
            <div className="space-item">제품 2</div>
            <div className="space-item">제품 3</div>
            <div className="space-item">제품 4</div>
            <div className="space-item">제품 5</div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
